import React from 'react';
import { BrowserRouter as Router, } from 'react-router-dom';

const CategoryCourses = (props) => {
  return (
    <Router >
      {
        props.category.map((e, i) => {
          return <div key={i}>
            <div className='course'>{e.name}</div>
          </div>
        })
      }
    </Router>
  );
};
export default CategoryCourses;
